package a01_diexp.vo;

public class Apartment {
	private String dong;
	private String hosu;
	public Apartment() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Apartment(String dong, String hosu) {
		super();
		this.dong = dong;
		this.hosu = hosu;
	}
	public String getDong() {
		return dong;
	}
	public void setDong(String dong) {
		this.dong = dong;
	}
	public String getHosu() {
		return hosu;
	}
	public void setHosu(String hosu) {
		this.hosu = hosu;
	}
	
	
}
